import React from "react";
import "./Home.css";

export default function Home() {
  return (
    <div className="Home">
      <div className="lander">
        <h1>Neighborhood</h1>
        <p>Play game with friends even when they're not in the neighborhood.</p>
      </div>
      <Button block bssize="large">Start a Texas Hold'em Table</Button>
    </div>
  );
}
